import React from 'react';
import CardList from './CardList';

const SearchCard = ({searchCard}) => {
	return (
		<div>
			{ kittens.map((user, i) => {
							return <Card key={i} 
										 id={kittens[i].id} 
										 name={kittens[i].name} 
										 email={kittens[i].email}/>
										})	
						}
			onClick={searchCard}
		</div>
		);
}

export default SearchCard;
